(23031, 'dwqa_subscrible_new_comment_answer_email', '<div style="background: #f5f5f5; color: #333; font-size: 14px; line-height: 20px; font-family: Helvetica Neue, Helvetica, Arial, sans-serif;">\r\n<div style="width: 600px; margin: 0 auto;">\r\n<div style="border-bottom: 1px solid #ddd; padding: 20px 0; text-align: center;">{site_logo}</div>\r\n<div style="padding: 10px 0 40px;">\r\n<p>Howdy {answer_author},</p>\r\n<table width="100%" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td valign="top" width="80">\r\n<div style="width: 60px; height: 60px; background: #ddd; text-align: center; word-wrap: break-word;">{comment_author_avatar}</div>\r\n</td>\r\n<td valign="top">\r\n<p style="font-size: 14px; line-height: 20px; color: #333; font-family: Helvetica Neue, Helvetica, Arial, sans-serif;"><a style="text-decoration: none; color: #f7682c;" href="{comment_author_link}">{comment_author}</a> has commented on your answer at "<a style="text-decoration: none; color: #f7682c;" href="{comment_link}">{question_title}</a>": <br /> {comment_content}</p>\r\n<div style="padding: 10px 0 0;"><a class="btn" style="color: #fff; border-radius: 3px; text-decoration: none; background-color: #f7682c; padding: 10px 20px; font-size: 14px; font-family: Helvetica Neue, Helvetica, Arial, sans-serif;" href="{comment_link}">View Comment →</a></div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div style="border-top: 1px solid #ddd; padding: 20px 0; clear: both; text-align: center;"><small style="font-size: 11px;">{site_name} - {site_description}</small></div>\r\n</div>\r\n</div>', 'yes'),
