(551, 1, '2016-12-22 11:19:59', '2016-12-22 11:19:59', 'Can I get Amazon.com shipped to Doha?\r\n\r\n<img src="http://securewebtechnologies.com/finditdoha/wp-content/uploads/2016/12/8dBbLV.jpg" alt="8dbblv" width="410" height="237" class="aligncenter size-full wp-image-549" />\r\n\r\n\r\nWe would recommend using Aramex -- get it shipped to an Aramix forwarding box in the US and have Aramex handle the shipment to Qatar.\r\n', 'Can I get Amazon.com shipped to Doha?', '', 'publish', 'open', 'closed', '', 'can-i-get-amazon-com-shipped-to-doha', '', '', '2016-12-22 11:19:59', '2016-12-22 11:19:59', '', 0, 'http://securewebtechnologies.com/finditdoha/?post_type=dwqa-question&#038;p=551', 0, 'dwqa-question', '', '', 0, ''),
(552, 1, '2016-12-22 11:28:02', '2016-12-22 11:28:02', 'Where can I get swimming lessons for children\r\n\r\n\r\n<img src="http://securewebtechnologies.com/finditdoha/wp-content/uploads/2016/12/fGQqOU.jpg" alt="fgqqou" width="1024" height="680" class="aligncenter size-full wp-image-553" />\r\n\r\n\r\nThe major options are: Aspire Aqua Center and ACS Doha, which offers lessons to non-students as well.  Luxury hotel residences will arrange for private courses as well.\r\n', 'Where can I get swimming lessons for children', '', 'publish', 'open', 'closed', '', 'where-can-i-get-swimming-lessons-for-children', '', '', '2016-12-22 11:28:02', '2016-12-22 11:28:02', '', 0, 'http://securewebtechnologies.com/finditdoha/?post_type=dwqa-question&#038;p=552', 0, 'dwqa-question', '', '', 0, ''),
