(554, 1, '2016-12-22 11:29:34', '2016-12-22 11:29:34', 'Can I bring my cat to Doha?\r\n\r\n<img src="http://securewebtechnologies.com/finditdoha/wp-content/uploads/2016/12/gray_cat.jpg" alt="gray_cat" width="800" height="595" class="aligncenter size-full wp-image-555" />\r\n\r\nYes, a number of expats have brought their cat from overseas.  Check with housing to ensure your landlord approves keeping a cat and ensure to get permission in writing.\r\n', 'Can I bring my cat to Doha?', '', 'publish', 'open', 'closed', '', 'can-i-bring-my-cat-to-doha', '', '', '2016-12-22 11:29:34', '2016-12-22 11:29:34', '', 0, 'http://securewebtechnologies.com/finditdoha/?post_type=dwqa-question&#038;p=554', 0, 'dwqa-question', '', '', 0, ''),
