(557, 1, '2016-12-22 11:36:50', '2016-12-22 11:36:50', 'Where can I go desert camping?\r\n\r\n<img src="http://securewebtechnologies.com/finditdoha/wp-content/uploads/2016/12/hPPla8.jpg" alt="hppla8" width="500" height="294" class="aligncenter size-full wp-image-558" />\r\n\r\nQatar is fairly regulation-friendly and you can go most places.  Most prefer the inland sea area.\r\n', 'Where can I go desert camping?', '', 'publish', 'open', 'closed', '', 'where-can-i-go-desert-camping', '', '', '2016-12-22 11:36:50', '2016-12-22 11:36:50', '', 0, 'http://securewebtechnologies.com/finditdoha/?post_type=dwqa-question&#038;p=557', 0, 'dwqa-question', '', '', 0, ''),
