(561, 1, '2016-12-22 11:40:22', '2016-12-22 11:40:22', 'What do I do during dust storms?\r\n\r\n<img src="http://securewebtechnologies.com/finditdoha/wp-content/uploads/2016/12/uHufuV.jpg" alt="uhufuv" width="800" height="375" class="aligncenter size-full wp-image-562" />\r\n\r\n\r\nEnsure to close your AC to prevent sucking in dust.  Place wet towels on the bottom of outside-access doors to prevent dust from coming inside.\r\n', 'What do I do during dust storms?', '', 'publish', 'open', 'closed', '', 'what-do-i-do-during-dust-storms', '', '', '2016-12-22 11:40:22', '2016-12-22 11:40:22', '', 0, 'http://securewebtechnologies.com/finditdoha/?post_type=dwqa-question&#038;p=561', 0, 'dwqa-question', '', '', 0, ''),
